import React from "react";
import { BrowserRouter, Switch, Route } from "react-router-dom";

import './App.css';

import { LoginPage } from './components/LoginPage';

function App() {
  return (
    <div>



      <BrowserRouter>
        {/* <Routes>

          <Route path="/login" element={<LoginPage />} />
          <Route path="*" element={() => { <div>Other pages</div> }} />

        </Routes> */}

        <Switch>
          <Route path="/login">
            <LoginPage />
          </Route>
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
